geregisseerd door Amy Heckerling
met Michelle Pfeiffer, Paul Rudd en Saoirse Ronan

Een moeder wordt verliefd op een veel jongere man, terwijl haar dochter tegelijkertijd voor de eerste keer verliefd wordt. Ondertussen blijft Moeder Natuur telkens met hun levens sollen.

